const Awards = (props) => {
    //Award generation
    var yearArray = props.awards.split('|');
    var col2 = [];

    function awardSplitter(awardArray,i){
        var col = [];
        for (var i=0; i<awardArray.length; i++){
            var pointsArray = awardArray[i].split('-');
            col.push(<p><b style={{color:'black'}}>{pointsArray[0]}</b></p>);
            col.push(<div style={{height:'0px',width:'100%'}}></div>);
            for (var j=1; j<pointsArray.length; j++){
                col.push(<p>{pointsArray[j]} </p>);
                col.push(<div style={{height:'0px',width:'100%'}}></div>);
            }
        }
        return col;
    }

    function yearSplitter(yearArray){
        var col1 = [];
        for (var a=0; a<yearArray.length; a=a+2){
            col1.push(<div className="col my-col"><h1>{yearArray[a]}</h1></div>)
            var awardArray=yearArray[a+1].split(",");
            var splitterResult=awardSplitter(awardArray,a);
            col1.push(<div className="col">{splitterResult}</div>)
        }
        return col1;
    }

    var result=yearSplitter(yearArray);

    for (var a=0; a<yearArray.length; a=a+2){
        col2.push(<div className="row my-row">{result}</div>);
    }




    return (
    <div className="row bound">
        {col2}
    </div>
    )
}

export default Awards
